import React from "react";
import useRefExample from "../src/useRefExample";

const useRefEx = () => {
  return (
    <div>
      <useRefExample primaryPic="/static/CommonLoon.jpg" secondaryPic="" />
      <br />
      <useRefExample primaryPic="/static/CrackingArt.jpg" secondaryPic="" />
    </div>
  );
};

export default useRefEx;
